import React from 'react';
import PropTypes from 'prop-types';

function Food({name, ho, rating}) {
  
 return  (
 <div>
    <h2>{rating}/5.0</h2>
    <img src = {ho} alt= {name} />
  </div>
 );
}

const foodlike = [
 {
   id : 1,
   name : 'kimchi',
   image : 'data:image/jpeg;base64,'
   , rating : 5
 },
 {
   id : 2,
   image : 'data:image/jpeg;base64,',
   name : 'gamja',
   rating : 4.9
 }
];

Food.propTypes = {

  name : PropTypes.string.isRequired,
  rating : PropTypes.string.isRequired
};



function App() {  //app component
 
  return (
      <div>
        {foodlike.map(dish => ( <Food key={dish.id} rating= {dish.rating} name = {dish.name} ho= {dish.image}/>))}  
      </div>
  );

}


export default App;
